import WalletConnectProvider from "@walletconnect/web3-provider";
import { INFURA_TEST_TESTNET_TOKEN } from "utils/env-constants";
export const web3ModalSetup = (chainId: string) => {
  return {
    chainId: chainId,
    providerOptions: {
      injected: {
        display: {
          logo: `data:image/gif;base64,`,
          name: "Metamask",
        },
        package: null,
      },
      walletconnect: {
        display: {
          logo: `data:image/gif;base64,`,

          name: "Walletconnect",
        },
        options: {
          infuraId: INFURA_TEST_TESTNET_TOKEN,
        },
        package: WalletConnectProvider,
        connector: async (ProviderPackage: any, options: any) => {
          const provider = new ProviderPackage(options);

          await provider.enable();

          return provider;
        },
      },
    },
  };
};
